import pizzaData from "./data"

export default function App() {
    return (
        <div>
            <Headers />
            {pizzaData.map((pizza) => (
                <Pizza pizza={pizza} key={pizza.name} />
            ))}
            {/* <Pizza name="Pizza Broculli" desc="Delicious and crispy from inside" price="12" />
            <Pizza name="Chicken Pizza" desc="Delicious and crispy from inside" price="15" /> */}
        </div>
    )
}

function Pizza({ pizza }) {
    const { name, photoName, ingredients, price } = pizza;
    return <div>
        <img src={photoName} alt={name} />
        <h2>{name}</h2>
        <p>{ingredients}</p>
        <p>{price}</p>
    </div>
}

function Headers() {
    const pizzaTitle = pizzaData;
    return <div>
        <h1>Fast Pizza Company</h1>
        <h2>Our Menu</h2>
        {pizzaTitle.length > 0 && <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s,</p>}

    </div>
}
